import classNames from "classnames";
import { useRef } from "react";
import { InputCheckboxComponent } from "./types";

export const InputCheckbox: InputCheckboxComponent = ({ id, checked , disabled, onChange }) => {
    const { current: inputId } = useRef(`RampInputCheckbox-${id}`);

    console.log("checked prop value:", checked);
    console.log("disabled prop value:", disabled);

    const labelClassNames = classNames("RampInputCheckbox--label", {
        "RampInputCheckbox--label-checked": checked,
        "RampInputCheckbox--label-disabled": disabled,
    });

    console.log("labelClassNames value:", labelClassNames);

    return (
        <div className="RampInputCheckbox--container" data-testid={inputId}>
            <label className={labelClassNames}/>
            <input
                id={inputId}
                type="checkbox"
                className="RampInputCheckbox--input"
                checked={checked}
                disabled={disabled}
                onChange={() => onChange(!checked)}
            />
        </div>
    );
};
